export default function Product({ title, category, price, description, image}) {
  return (
    <div>
      <div style={{ backgroundImage: `url(${image})` }}></div>
      <div>
        <h3>{title}</h3>
        <p>{category}</p>
        <p>{price}</p>
        <p>{description}</p>
      </div>
    </div>
  );
}
